import React, {Component} from 'react'
import './OptionsList.css'
import '../components/RouteLink'

class OptionsList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            optionsState: 'emp'
        }
    }

    render() {
        return(
            <div id='oList'>
                <RouteLink />
            </div>
        )
    }
}

export default OptionsList;
